import React from "react";
import Head from "next/head";
import HealthArticle from "../health-article/health-article";

export default function Index(props) {
	console.log(props.content);
	return (
		<>
			<Head>
				<title>Protalk App</title>
				<link rel="icon" href="/favicon.ico" />
				<meta charSet="utf-8" />
				<meta
					name="viewport"
					content="initial-scale=1.0, width=device-width"
				/>
			</Head>
			<div>
				<HealthArticle blog_content={props.content} />
			</div>
		</>
	);
}

export const getServerSideProps = async (ctx: {
	blog_id: string;
	blog_content: string;
}) => {
	// ...
	const res = await fetch(
		"https://run.mocky.io/v3/9653306b-1fd2-4b43-b69b-1e456702d639"
	);
	const data = await res.json();
	return {
		props: { id: data.blog_id, content: data.blog_content }
	};
};
